// frontend/src/components/SafetyInspectionCard.jsx
import React from 'react';
import './Card.css';

const SafetyInspectionCard = ({ data, onUpdate, onSend }) => {
  const handleSubmit = (e) => {
    e.preventDefault();
    if (onSend) {
      onSend();
    }
  };

  return (
    <div className="card">
      <h2 className="card__title">Safety Inspection</h2>
      <form className="form" onSubmit={handleSubmit}>
        <label>
          <span>Location</span>
          <input type="text" name="location" value={data.location} onChange={onUpdate} />
        </label>
        <label>
          <span>Require Human Intervention</span>
          <input
            type="checkbox"
            name="require_human_intervention"
            checked={data.require_human_intervention}
            onChange={onUpdate}
          />
        </label>
        <button type="submit" className="btn">Send</button>
      </form>
    </div>
  );
};

export default SafetyInspectionCard;
